import React from "react";

export default function DashboardLayout({ children }) {
  return (
    <div style={{
      display: "flex",
      minHeight: "100vh",  /* full viewport height */
      width: "100%",
      background: "#f5f5f5",
    }}>
      {/* Sidebar */}
      

      {/* Main content */}
      <div style={{ flex: 1, padding: "20px" }}>
        {children}
      </div>
    </div>
  );
}
